import { StyleSheet } from 'react-native';

var styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 24,
      backgroundColor: '#a9a9a9',
      alignItems: 'center',
      justifyContent: 'center',
    },
    title: {
      marginTop: 0,
      paddingVertical: 0,
      //borderWidth: 1,
      //borderColor: "#20232a",
      //borderRadius: 1,
      //backgroundColor: "#821426",
      color: "#20232a",
      textAlign: "center",
      fontSize: 20,
      fontWeight: "bold"
    },

    button: {
      height: 40,
      width: 200,
      marginTop: 0,
      padding: 0,
      justifyContent: 'center',
      backgroundColor: 'red',
      alignContent: 'center',
      flexDirection: 'row'
    }
  });

  export default styles;
